INSERT INTO `wp_commentmeta` VALUES (228704, 79518, 'akismet_as_submitted', 'a:58:{s:15:"comment_post_ID";s:5:"20842";s:14:"comment_author";s:9:"Anonymous";s:20:"comment_author_email";s:13:"anon@anon.com";s:18:"comment_author_url";s:0:"";s:15:"comment_content";s:2971:"Thought I should share this from a Gotham Schools Article:\r\n\r\nThe story behind the first strike against the Cahn/Moon ticket particularly reflects unfair jurisdiction on thepart of the BOE and indicates that, for future elections, election rules must be clarified and more strictly defined in order to avoid such uneven punishment by the BOE.\r\n\r\nCahn’s first strike was granted because of the “use of in-school resources for campaign materials.” As a member of the Student Union, Jack Cahn stored a box of garbage in the SU office which he promptly discarded. It would be absurd to say this practice was an inappropriate use of “in-school resources,” and this practice did not at all give Cahn an unfair advantage in the race. What does “in-school resources” really entail? Technically, because of the foolish lack of specificity in this term, school lockers count as “in-school resources.” Therefore, if either candidate had stored campaign materials in their lockers, this would have counted as “use of in-school resources for campaign materials.” Say either candidate had rested their schoolbag containing campaign materials on a hook in a bathroom stall; such a practice could have also been labeled as “use of in-school resources for campaign materials.”\r\n\r\nThe point of my ridiculous extrapolations is to demonstrate that due to the lack of clarity in the election rules, the BOE can proactively strike a candidate for practically anything, if the BOE feels inclined enough to do so. Instead of acting as the fair, neutral body that it should be, the BOE demonstrated that it interprets rules to different degrees depending on the candidate at hand. A former BOE chairman was quoted on GothamSchools as saying, “Even though these rules might be antiquated and might seem unfair, we can’t change the rules in the middle.” But the issue at hand is not about changing the rules;\r\nthe issue is about clarifying them. Jack Cahn did not break an election rule. The BOE interpreted the rule so that he would inevitably break it.\r\n\r\nThis heavy-handed use of authority is especially ironic considering that the BOE has no mandate of power. Jeremy Majerovitz (Stuy ’12) discovered that Article V Sec 1 Clause 6 of the SU Constitution was legitimate grounds on which to claim that the BOE should not even exist. According to this clause of the constitution, all cabinet positions are appointed by the SU president, and the president may dismiss non-elected members but must reappoint them immediately. Given that no other power to appoint is conferred in the SU Constitution, the BOE is illegitimate because none of its members were ever appointed by the SU President. To those who support the BOE and say that this application of the constitution is unfair, I bring you to the words of one of your own: “Even though these rules might be antiquated and might seem unfair, we can’t change the rules in the middle.”\r\n\r\n-Nancy Ko, Stuy \'13";s:12:"comment_type";s:0:"";s:14:"comment_parent";s:1:"0";s:7:"user_ID";s:1:"0";s:7:"user_ip";s:12:"74.72.44.164";s:10:"user_agent";s:120:"Mozilla/5.0 (Macintosh; Intel Mac OS X 10_8_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/27.0.1453.110 Safari/537.36";s:8:"referrer";s:53:"http://stuyspectator.com/2013/06/12/the-inside-scoop/";s:4:"blog";s:24:"http://stuyspectator.com";s:9:"blog_lang";s:5:"en_US";s:12:"blog_charset";s:5:"UTF-8";s:9:"permalink";s:53:"http://stuyspectator.com/2013/06/12/the-inside-scoop/";s:21:"akismet_comment_nonce";s:6:"passed";s:11:"POST_author";s:9:"Anonymous";s:10:"POST_email";s:13:"anon@anon.com";s:8:"POST_url";s:0:"";s:12:"POST_comment";s:2971:"Thought I should share this from a Gotham Schools Article:\r\n\r\nThe story behind the first strike against the Cahn/Moon ticket particularly reflects unfair jurisdiction on thepart of the BOE and indicates that, for future elections, election rules must be clarified and more strictly defined in order to avoid such uneven punishment by the BOE.\r\n\r\nCahn’s first strike was granted because of the “use of in-school resources for campaign materials.” As a member of the Student Union, Jack Cahn stored a box of garbage in the SU office which he promptly discarded. It would be absurd to say this practice was an inappropriate use of “in-school resources,” and this practice did not at all give Cahn an unfair advantage in the race. What does “in-school resources” really entail? Technically, because of the foolish lack of specificity in this term, school lockers count as “in-school resources.” Therefore, if either candidate had stored campaign materials in their lockers, this would have counted as “use of in-school resources for campaign materials.” Say either candidate had rested their schoolbag containing campaign materials on a hook in a bathroom stall; such a practice could have also been labeled as “use of in-school resources for campaign materials.”\r\n\r\nThe point of my ridiculous extrapolations is to demonstrate that due to the lack of clarity in the election rules, the BOE can proactively strike a candidate for practically anything, if the BOE feels inclined enough to do so. Instead of acting as the fair, neutral body that it should be, the BOE demonstrated that it interprets rules to different degrees depending on the candidate at hand. A former BOE chairman was quoted on GothamSchools as saying, “Even though these rules might be antiquated and might seem unfair, we can’t change the rules in the middle.” But the issue at hand is not about changing the rules;\r\nthe issue is about clarifying them. Jack Cahn did not break an election rule. The BOE interpreted the rule so that he would inevitably break it.\r\n\r\nThis heavy-handed use of authority is especially ironic considering that the BOE has no mandate of power. Jeremy Majerovitz (Stuy ’12) discovered that Article V Sec 1 Clause 6 of the SU Constitution was legitimate grounds on which to claim that the BOE should not even exist. According to this clause of the constitution, all cabinet positions are appointed by the SU president, and the president may dismiss non-elected members but must reappoint them immediately. Given that no other power to appoint is conferred in the SU Constitution, the BOE is illegitimate because none of its members were ever appointed by the SU President. To those who support the BOE and say that this application of the constitution is unfair, I bring you to the words of one of your own: “Even though these rules might be antiquated and might seem unfair, we can’t change the rules in the middle.”\r\n\r\n-Nancy Ko, Stuy \'13";s:11:"POST_submit";s:14:"Submit Comment";s:20:"POST_comment_post_ID";s:5:"20842";s:19:"POST_comment_parent";s:1:"0";s:26:"POST_akismet_comment_nonce";s:10:"2358cd9ca2";s:15:"SERVER_SOFTWARE";s:9:"LiteSpeed";s:11:"REQUEST_URI";s:21:"/wp-comments-post.php";s:11:"HTTP_ACCEPT";s:63:"text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8";s:20:"HTTP_ACCEPT_ENCODING";s:17:"gzip,deflate,sdch";s:20:"HTTP_ACCEPT_LANGUAGE";s:14:"en-US,en;q=0.8";s:15:"HTTP_CONNECTION";s:10:"keep-alive";s:12:"CONTENT_TYPE";s:33:"application/x-www-form-urlencoded";s:14:"CONTENT_LENGTH";s:4:"3339";s:11:"HTTP_COOKIE";s:0:"";s:9:"HTTP_HOST";s:17:"stuyspectator.com";s:12:"HTTP_REFERER";s:53:"http://stuyspectator.com/2013/06/12/the-inside-scoop/";s:15:"HTTP_USER_AGENT";s:120:"Mozilla/5.0 (Macintosh; Intel Mac OS X 10_8_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/27.0.1453.110 Safari/537.36";s:18:"HTTP_CACHE_CONTROL";s:9:"max-age=0";s:11:"HTTP_ORIGIN";s:24:"http://stuyspectator.com";s:13:"DOCUMENT_ROOT";s:26:"/home/stuyspec/public_html";s:11:"REMOTE_ADDR";s:12:"74.72.44.164";s:11:"REMOTE_PORT";s:5:"48133";s:11:"SERVER_ADDR";s:14:"199.189.248